import React from "react";
import ContentLoading from "./ContentLoading";
import ContentItems from "./ContentItems";

function ContentLoadMore({ posts }) {
  const ListLoading = ContentLoading(ContentItems);
  return (
    <>
      {posts &&
        posts.length > 0 &&
        posts.map((p, i) => <ListLoading key={i} data={p} index={i} isLoading={p.loading} />)}
    </>
  );
}

export default ContentLoadMore;
